--
-- ALTER NOBELISTS TO INCLUDE A FOREIGN KEY TO BIRTH CITY GIS LAYER
-- 

ALTER TABLE nobelists ADD COLUMN birth_city_id INT REFERENCES nobelist_cities(id);
UPDATE nobelists SET birth_city_id = (SELECT id FROM nobelist_cities WHERE city = birth_city AND country = birth_country);

---
--- SET UP FACET INDICES
---

--
-- CONSTRUCT A CONTROLLED VOCABULARY OF FEATURES
--
-- IN THIS STEP, ALSO DO ANY REPROJECTION AND SIMPLIFICATION NECESSARY
--
--  (THE SRID EPSG:4269 IS REQUIRED FOR ALL DATA SHOWN IN GOOGLE EARTH)
--  (RE-PROJECTIONS PROVIDED FOR REFERENCE -  THIS DATA ALREADY IN EPSG:4269)
--

CREATE TABLE birthplace_geom_vocabulary(id SERIAL, label TEXT, layer INTEGER);
SELECT AddGeometryColumn('birthplace_geom_vocabulary', 'display_geom', 4269, 'GEOMETRY', 2);
SELECT AddGeometryColumn('birthplace_geom_vocabulary', 'full_geom', 4269, 'GEOMETRY', 2);

INSERT INTO birthplace_geom_vocabulary(label, layer, display_geom, full_geom)
  SELECT country, 1, ST_SimplifyPreserveTopology(ST_Transform(the_geom, 4269), 0.002), the_geom FROM nobelist_countries;

INSERT INTO birthplace_geom_vocabulary(label, layer, display_geom, full_geom)
  SELECT city, 2, ST_Transform(the_geom, 4269), the_geom FROM nobelist_cities;

--
-- CREATE THE GIS FACET INDEX
--
-- SLIGHTLY MORE COMPLEX THAN ORDINARY FACET BECAUSE WE USE A LEFT OUTER JOIN AND COALESCE TO
-- ENSURE THE INDEX INCLUDES ALL GIS FEATURES, NOT JUST ONES ASSOCIATED WITH A NOBELIST
--

SELECT recreate_table('_nobelists_birthplace_geom_facet', $$
  SELECT md5(full_geom::bytea) AS birthplace_geom, label, layer, display_geom, full_geom, coalesce(signature, '0'::signature) AS signature
  FROM birthplace_geom_vocabulary
    LEFT OUTER JOIN
    (SELECT birthplace_geom_vocabulary.id AS vocab_id, signature(_packed_id)
     FROM birthplace_geom_vocabulary,
          nobelists JOIN nobelist_cities ON (birth_city_id = nobelist_cities.id)
     WHERE ST_Within(nobelist_cities.the_geom, birthplace_geom_vocabulary.full_geom)
     GROUP BY birthplace_geom_vocabulary.id) AS signatures
  ON (vocab_id = birthplace_geom_vocabulary.id)
$$);

CREATE INDEX _nobelists_birthplace_geom_facet_ndx ON _nobelists_birthplace_geom_facet USING gist(full_geom);


